webpackJsonp([76538528952971],{7915:function(t,o){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/682463062/" title="Photo Sharing"><img src="http://farm2.static.flickr.com/1070/682463062_b2525d2d91.jpg" width="500" height="375" alt="IMG_2069" /></a></p>\n<p>Even though we got home at 3:30 this morning, Christopher insisted on going to the restaurant at 9:00 am for his first day of "work". We were actually already awake, I guess we can catch up on sleep later.</p>\n<p><a href="http://www.flickr.com/photos/papascott/683006302/" title="Photo Sharing"><img src="http://farm2.static.flickr.com/1394/683006302_cd6a535f3a_o.jpg" width="330" height="250" alt="crh_work" /></a></p>\n<p>Christopher actually kept himself busy for nearly 3 hours. My CF card ate the rest of the photos I took today, but I was able to recover the thumbnails.</p>',fields:{title:'First Day of "Work"',date:"01 Jul 2007",url:"https://papascott.de/2007-07-01-first-day-of-work/"}}},pathContext:{slug:"/2007-07-01-first-day-of-work/",prev:{fields:{title:"14 Hours",date:"30 Jun 2007",slug:"/2007-06-30-14-hours/"}},next:{fields:{title:"Our Name On The Door",date:"01 Jul 2007",slug:"/2007-07-01-our-name-on-the-door/"}}}}}});
